import header from "./navigation.module.css"


function Navigation(){
    return(

        <header>
        <a className={header.logo}>PortFolio</a>

        <ul>
            <li><a href="#home">Home</a></li>
            <li><a href="#about">About Us</a></li>
            <li><a href="#contact">Contact</a></li>
        </ul>
    </header>

    );
}

export default Navigation;
